import React from "react";
import {
  interaction,
  layer,
  custom,
  control, //name spaces
  Interactions,
  Overlays,
  Controls, //group
  Map,
  Layers,
  Overlay,
  Util, //objects
} from "react-openlayers";

const MapPage = () => {
  const showPopup = () => {
    console.log("popup!");
  };
  var marker = new custom.style.MarkerStyle(
    "https://www.google.com/url?sa=i&url=https%3A%2F%2Fwww.pinclipart.com%2Fpindetail%2FiiToRJi_map-marker-icon-location-icon-png-clipart%2F&psig=AOvVaw15OEpctuur2aGwZ7djFOzl&ust=1627329195164000&source=images&cd=vfe&ved=0CAsQjRxqFwoTCOC95ef__vECFQAAAAAdAAAAABAD"
  );
  let selectedMarkerStyle = Util.cloneObject(marker.style);
  selectedMarkerStyle.getImage().setOpacity(1);
  return (
    <>
      <Map view={{ center: [0, 0], zoom: 2 }} onClick={showPopup}>
        <Layers>
          <layer.Tile />
          {/* <layer.Vector source={markers} style={markers.style} zIndex="1" /> */}
        </Layers>
        <Overlays>
          {/* <Overlay ref={(comp) => (this.overlayComp = comp)} element="#popup" /> */}
        </Overlays>
        <Controls attribution={false} zoom={true}>
          <control.Rotate />
          <control.ScaleLine />
          <control.FullScreen />
          <control.OverviewMap />
          <control.ZoomSlider />
          <control.ZoomToExtent />
          <control.Zoom />
        </Controls>
        <Interactions>
          {/* <interaction.Select style={selectedMarkerStyle} /> */}
          {/* <interaction.Draw source={markers} type="Point" /> */}
          {/* <interaction.Modify features={markers.features} /> */}
        </Interactions>
      </Map>
      {/* <custom.Popup ref={(comp) => (this.popupComp = comp)}></custom.Popup> */}
    </>
  );
};

export default MapPage;
